import Issues from './Issues'
import axios from 'axios'

export const addIssue = (issueTitle, issueDescription, issueLabels) => {
  const url = 'https://issue-tracker-spring-boot.herokuapp.com/issue'
  const issue = {
    title: issueTitle,
    description: issueDescription,
    labels: issueLabels
  }

  axios.post(
    url,
    { title: 'issue deneme', description: 'desc deneme', labels: {labelName:"frontend"} },
    {
      headers: {
        'content-type': 'application/json'
      }
    }
  )
}
